import { Modal, Button } from 'react-bootstrap';
import { useState } from 'react';


const SearchMovie = () => {
  const [showModal, setShowModal] = useState(false);

  const handleOpenModal = () => {
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  return (
    <div>
        <button type="button" class="DocSearch DocSearch-Button MyButton" aria-label="Search" onClick={handleOpenModal}>
            <span class="DocSearch-Button-Container">
                <svg width="20" height="20" class="DocSearch-Search-Icon" viewBox="0 0 20 20">
                <path d="M14.386 14.386l4.0877 4.0877-4.0877-4.0877c-2.9418 2.9419-7.7115 2.9419-10.6533 0-2.9419-2.9418-2.9419-7.7115 0-10.6533 2.9418-2.9419 7.7115-2.9419 10.6533 0 2.9419 2.9418 2.9419 7.7115 0 10.6533z" stroke="currentColor" fill="none" fill-rule="evenodd" stroke-linecap="round" stroke-linejoin="round"></path>
                </svg>
                <span class="DocSearch-Button-Placeholder">Search</span>
            </span>
        </button>

        <Modal show={showModal} onHide={handleCloseModal} size='lg'>
            <Modal.Body>
                <div className='DocSearch-SearchBar'>
                    <form className='DocSearch-Form'>
                        <label className="DocSearch-MagnifierLabel" htmlFor="docsearch-input" id="docsearch-label">
                        <svg width="20" height="20" className="DocSearch-Search-Icon" viewBox="0 0 20 20">
                            <path d="M14.386 14.386l4.0877 4.0877-4.0877-4.0877c-2.9418 2.9419-7.7115 2.9419-10.6533 0-2.9419-2.9418-2.9419-7.7115 0-10.6533 2.9418-2.9419 7.7115-2.9419 10.6533 0 2.9419 2.9418 2.9419 7.7115 0 10.6533z" stroke="currentColor" fill="none" fillRule="evenodd" strokeLinecap="round" strokeLinejoin="round"></path>
                        </svg>
                        </label>
                        <input className="DocSearch-Input" aria-autocomplete="both" aria-labelledby="docsearch-label" id="docsearch-input" autoComplete="off" autoCorrect="off" autoCapitalize="off" enterKeyHint="search" spellCheck="false" placeholder="Search docs" maxLength="64" type="search" value="" />
                    </form>
                </div>
            </Modal.Body>
            <Modal.Footer>
                <Button variant="secondary" onClick={handleCloseModal}>
                    Cerrar
                </Button>
            </Modal.Footer>
        </Modal>

    </div>
  );
};

export default SearchMovie;
